import React, { useEffect, useState } from "react";
import axios from "axios";
import { DataGrid } from "@mui/x-data-grid";

const Home = () => {
  const [bajones, setBajones] = useState([]);

  useEffect(() => {
    axios
      .get("/prueba")
      .then((res) => {
        const data = res.data;
        setBajones(data);
      })
      .catch((err) => console.log(err));
  }, []);

  return (
    <div className="main-containe">
      <table>
        <thead>
          <tr>
            <th>Nombre de empleado</th>
            <th>Sector</th>
            <th>Edad</th>
            <th>Email</th>
          </tr>
        </thead>
        <div>

        {bajones.map((bajon) => (
          <div>
            <h1>{bajon.name}</h1>
            <h1>{bajon.age}</h1>
            <h1>{bajon.sector}</h1>
            <h1>{bajon.email}</h1>
          </div>
        ))}

    </div>
        <tr>
          <td>Agua</td>
          <td>Enero</td>
          <td>$ 3,000</td>
        </tr>
        <tr>
          <td>Luz</td>
          <td>Febrero</td>
          <td>$ 5,500</td>
        </tr>
        <tr>
          <td>Coche</td>
          <td>Marzo</td>
          <td>$ 10,100</td>
        </tr>
        <tr>
          <td>Internet</td>
          <td>Abril</td>
          <td>$ 450</td>
        </tr>
      </table>
    </div>
  );
};

export default Home;
